function mouseToKey(x, y)
{
    // simply look up the key in the map
    if (x < 0 || x >= 240 || y < 0 || y >= 320)
        return null;
    var key = keys[y].substr(x, 1);
    if (key == 'X')
        return null;
    return key;
}

var lastUpdate = null;
function update(highlight)
{
    var s = "images/" + mode;
    if (highlight != null)
        s += "_highlight" + highlight;
    var img = s + ".png";
    if (lastUpdate != img)
    {
        //navigator.notification.vibrate(0);
        document.getElementById("xnav").src = img;
        lastUpdate = img;
    }
}

